  `usuario_importador_a_cob` int(11) NULL DEFAULT NULL,
  `fecha_importacion_a_cob` date NULL DEFAULT NULL,
  `ajustada` tinyint(1) NULL DEFAULT 0 COMMENT '1 = ajustada',
  `fecha_asignacion_cobrador` date NULL DEFAULT NULL,
  `usuario_asignacion_cobrador` int(11) NULL DEFAULT NULL,
  `cobrador` int(11) NULL DEFAULT NULL,
  `fecha_pag` date NULL DEFAULT NULL,
  `agencia_pag` smallint(6) NULL DEFAULT NULL,
  `fraccionada` int(10) NULL DEFAULT 0,
  `fecha_ajuste` date NULL DEFAULT NULL,
  `usuario_ajuste` int(10) NULL DEFAULT NULL,
  `id_liq_primitiva` int(11) NULL DEFAULT NULL,
  `usuario_fraccionamiento` int(10) NULL DEFAULT NULL,
  `fecha_fraccionamiento` date NULL DEFAULT NULL,
  `usuario_recurrida` int(11) NULL DEFAULT NULL,
  `fecha_recurrida` date NULL DEFAULT NULL,
  `id_resolucion` int(11) NULL DEFAULT 0,
  `usuario_devolucion` int(11) NULL DEFAULT NULL,
  `fecha_devolucion` date NULL DEFAULT NULL,
  `usuario_reverso` int(11) NULL DEFAULT NULL,
  `fecha_reverso` date NULL DEFAULT NULL,
  `usuario` int(11) NULL DEFAULT NULL,
  `fecha_proceso` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `borrado` tinyint(4) NULL DEFAULT 0,
  `moneda` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT 'EUR',
  PRIMARY KEY (`id_liquidacion`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Compact;

