-- ----------------------------
-- View structure for contribuyentess
-- ----------------------------
DROP VIEW IF EXISTS `contribuyentess`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `contribuyentess` AS select `contribuyentes`.`rif` AS `rif`,`contribuyentes`.`contribuyente` AS `contribuyente`,`contribuyentes`.`DescripcionDomicilio` AS `DescripcionDomicilio`,`contribuyentes`.`Telefonos` AS `Telefonos`,`contribuyentes`.`Especial` AS `Especial`,`dir_estados`.`descripcion` AS `Descripcion_estado`,`dir_ciudades`.`descripcion` AS `Descripcion_ciudad`,`a_actividades`.`descripcion` AS `Descripcion_actividad`,`dir_zonas`.`descripcion` AS `Descripcion_zona` from ((((`contribuyentes` join `dir_estados` on((`contribuyentes`.`id_estado` = `dir_estados`.`id_estado`))) join `dir_ciudades` on((`contribuyentes`.`id_ciudad` = `dir_ciudades`.`id_ciudad`))) join `a_actividades` on((`contribuyentes`.`actividad` = `a_actividades`.`id_actividad`))) join `dir_zonas` on((`contribuyentes`.`id_zona` = `dir_zonas`.`id_zona`))) where ((`contribuyentes`.`id_estado` = 12) and (`dir_ciudades`.`id_ciudad` = 62)) ;

-- ----------------------------
-- View structure for vbienes_pendientes
-- ----------------------------
DROP VIEW IF EXISTS `vbienes_pendientes`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `vbienes_pendientes` AS SELECT
	z_jefes_detalle.id_sector AS id_sector_actual, 
	z_jefes_detalle.division AS id_division_actual, 
	z_jefes_detalle.descripcion AS division_actual, 
	bn_bienes_x_reasignar.interno, 
	bn_bienes.por_reasignar, 
	bn_areas.id_area AS id_area_actual, 
	bn_areas.descripcion AS area_actual, 
	bn_bienes.id_bien, 
	bn_bienes.numero_bien, 
	bn_bienes.descripcion_bien, 
	bn_bienes_x_reasignar.id_area_destino, 
	bn_areas2.descripcion AS area_destino, 
	z_jefes_detalle2.descripcion AS division_destino, 
	bn_areas2.division AS id_division_destino, 
	bn_bienes.borrado, 
	bn_categorias.id_categoria, 
	bn_categorias.codigo as codigo_categoria, 
	bn_categorias.descripcion as categoria
FROM
	bn_bienes
	INNER JOIN
	bn_bienes_x_reasignar
	ON 
		bn_bienes.id_bien = bn_bienes_x_reasignar.id_bien
	INNER JOIN
	bn_areas
	ON 
		bn_bienes.id_area = bn_areas.id_area
	INNER JOIN
	z_jefes_detalle
	ON 
		bn_areas.division = z_jefes_detalle.division
	INNER JOIN
	bn_areas AS bn_areas2
	ON 
		bn_bienes_x_reasignar.id_area_destino = bn_areas2.id_area
	INNER JOIN
	z_jefes_detalle AS z_jefes_detalle2
	ON 
		bn_areas2.division = z_jefes_detalle2.division
	INNER JOIN
	bn_categorias
	ON 
		bn_bienes.id_categoria = bn_categorias.id_categoria ;

-- ----------------------------
-- View structure for vbienes_reasignaciones
-- ----------------------------
DROP VIEW IF EXISTS `vbienes_reasignaciones`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `vbienes_reasignaciones` AS SELECT
  bn_bienes.por_reasignar,
  bn_bienes.id_bien,
  bn_bienes.numero_bien,
  bn_bienes.descripcion_bien,
  bn_bienes.borrado,
  bn_categorias.id_categoria,
  bn_categorias.codigo AS codigo_categoria,
  bn_categorias.descripcion AS categoria,
  bn_reasignaciones_detalle.id_reasignacion 
FROM
  bn_bienes
  INNER JOIN bn_categorias ON bn_bienes.id_categoria = bn_categorias.id_categoria
  INNER JOIN bn_reasignaciones_detalle ON bn_bienes.id_bien = bn_reasignaciones_detalle.id_bien
  INNER JOIN bn_reasignaciones ON bn_reasignaciones_detalle.id_reasignacion = bn_reasignaciones.id_reasignacion ;

-- ----------------------------
-- View structure for vbienes_rpu
-- ----------------------------
DROP VIEW IF EXISTS `vbienes_rpu`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `vbienes_rpu` AS select `bn_bienes`.`id_bien` AS `id_bien`,`bn_bienes`.`numero_bien` AS `numero_bien`,`bn_bienes`.`descripcion_bien` AS `descripcion_bien`,`bn_areas`.`descripcion` AS `area`,`bn_areas`.`division` AS `id_division`,`bn_areas`.`id_area` AS `id_area`,`bn_bienes`.`id_categoria` AS `id_categoria`,`bn_bienes`.`conservacion` AS `conservacion`,`bn_bienes`.`valor` AS `valor`,`bn_bienes`.`borrado` AS `borrado`,`bn_bienes`.`por_reasignar` AS `por_reasignar`,`bn_bienes`.`inf_ci_asignado` AS `inf_ci_asignado`,`bn_categorias`.`codigo` AS `codigo` from ((`bn_areas` join `bn_bienes` on((`bn_areas`.`id_area` = `bn_bienes`.`id_area`))) join `bn_categorias` on((`bn_bienes`.`id_categoria` = `bn_categorias`.`id_categoria`))) where (`bn_bienes`.`borrado` = 0) ;

-- ----------------------------
-- View structure for vistas_fiscales
-- ----------------------------
DROP VIEW IF EXISTS `vistas_fiscales`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `vistas_fiscales` AS select `z_empleados`.`Apellidos` AS `Apellidos`,`z_empleados`.`Nombres` AS `Nombres`,`z_sectores`.`nombre` AS `nombre`,`z_accesos_roles`.`modulo` AS `modulo`,`z_accesos_tipo`.`descripcion` AS `descripcion` from (((((`z_empleados_roles` join `z_empleados` on((`z_empleados_roles`.`cedula` = `z_empleados`.`cedula`))) join `z_sectores` on((`z_empleados`.`sector` = `z_sectores`.`id_sector`))) join `z_accesos_roles` on((`z_empleados_roles`.`rol` = `z_accesos_roles`.`id`))) join `z_empleados_accesos` on((`z_empleados`.`cedula` = `z_empleados_accesos`.`cedula`))) join `z_accesos_tipo` on((`z_empleados_accesos`.`acceso` = `z_accesos_tipo`.`acceso`))) where (((`z_empleados_accesos`.`acceso` >= 2) and (`z_empleados_accesos`.`acceso` <= 6)) or ((`z_empleados_accesos`.`acceso` = 90) and (`z_empleados_roles`.`rol` = 3))) ;

-- ----------------------------
-- View structure for vista_actas_hoja_sanciones_fis
-- ----------------------------
DROP VIEW IF EXISTS `vista_actas_hoja_sanciones_fis`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY INVOKER VIEW `vista_actas_hoja_sanciones_fis` AS select `fis_actas`.`anno_prov` AS `anno_prov`,`fis_actas`.`num_prov` AS `num_prov`,`fis_actas`.`anno` AS `anno`,`fis_actas`.`numero` AS `numero`,sum(`fis_actas_detalle`.`reparo`) AS `reparo`,sum(`fis_actas_detalle`.`impuesto_omitido`) AS `impuesto_omitido`,sum(`fis_actas_detalle`.`multa_actual`) AS `multa_actual`,`fis_actas_detalle`.`UT_actual` AS `UT_actual`,sum(`fis_actas_detalle`.`interes`) AS `interes`,`fis_actas`.`id_sector` AS `sector`,`a_tipo_providencia`.`Siglas1` AS `siglas`,`fis_actas_detalle`.`tributo` AS `tributo`,`fis_actas`.`fecha_notificacion` AS `fecha_notificacion`,`fis_actas`.`acta` AS `acta`,sum(`fis_actas_detalle`.`monto_pagado`) AS `ajuste_voluntario`,`fis_actas_detalle`.`fecha_pago` AS `fecha_pago`,`fis_actas`.`fecha` AS `fecha` from ((((`fis_actas` join `fis_actas_detalle` on((`fis_actas_detalle`.`id_acta` = `fis_actas`.`id_acta`))) join `a_tributos` on((`a_tributos`.`id_tributo` = `fis_actas_detalle`.`tributo`))) join `expedientes_fiscalizacion` on(((`expedientes_fiscalizacion`.`sector` = `fis_actas`.`id_sector`) and (`expedientes_fiscalizacion`.`anno` = `fis_actas`.`anno_prov`) and (`expedientes_fiscalizacion`.`numero` = `fis_actas`.`num_prov`)))) join `a_tipo_providencia` on((`a_tipo_providencia`.`tipo` = `expedientes_fiscalizacion`.`tipo`))) group by `fis_actas`.`anno_prov`,`fis_actas`.`num_prov`,`fis_actas`.`id_sector` ;

-- ----------------------------
-- View structure for vista_actas_siger
-- ----------------------------
DROP VIEW IF EXISTS `vista_actas_siger`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY INVOKER VIEW `vista_actas_siger` AS select `expedientes_fiscalizacion`.`rif` AS `rif`,concat(`z_siglas`.`Siglas_resol_fis`,_utf8'/',`vista_actas_hoja_sanciones_fis`.`anno_prov`,_utf8'/',`a_tipo_providencia`.`Siglas2`,_utf8'/',`a_tipo_providencia`.`Siglas1`,lpad(`vista_actas_hoja_sanciones_fis`.`num_prov`,4,_utf8'0'),_utf8'/',`vista_actas_hoja_sanciones_fis`.`anno`,_utf8'/',lpad(`vista_actas_hoja_sanciones_fis`.`numero`,4,_utf8'0')) AS `numacta`,`vista_actas_hoja_sanciones_fis`.`fecha` AS `fecha_emision`,`vista_actas_hoja_sanciones_fis`.`fecha_notificacion` AS `fecha_notificacion`,`vista_actas_hoja_sanciones_fis`.`reparo` AS `reparo`,`vista_actas_hoja_sanciones_fis`.`impuesto_omitido` AS `impuesto_omitido`,`vista_actas_hoja_sanciones_fis`.`multa_actual` AS `multa_actual`,`vista_actas_hoja_sanciones_fis`.`interes` AS `interes`,`z_sectores`.`nombre` AS `nombre`,`vista_actas_hoja_sanciones_fis`.`acta` AS `acta`,`vista_actas_hoja_sanciones_fis`.`ajuste_voluntario` AS `ajuste_voluntario`,`vista_actas_hoja_sanciones_fis`.`fecha_pago` AS `fecha_pago`,`vista_actas_hoja_sanciones_fis`.`siglas` AS `siglas`,`expedientes_fiscalizacion`.`programa` AS `programa`,`vista_actas_hoja_sanciones_fis`.`sector` AS `sector`,`vista_actas_hoja_sanciones_fis`.`anno_prov` AS `anno_prov`,`vista_actas_hoja_sanciones_fis`.`num_prov` AS `num_prov`,`contribuyentes`.`contribuyente` AS `contribuyente`,`dir_ciudades`.`descripcion` AS `ciudad`,`contribuyentes`.`DescripcionDomicilio` AS `direccion` from ((((((`vista_actas_hoja_sanciones_fis` join `expedientes_fiscalizacion` on(((`expedientes_fiscalizacion`.`sector` = `vista_actas_hoja_sanciones_fis`.`sector`) and (`expedientes_fiscalizacion`.`anno` = `vista_actas_hoja_sanciones_fis`.`anno_prov`) and (`expedientes_fiscalizacion`.`numero` = `vista_actas_hoja_sanciones_fis`.`num_prov`)))) join `a_tipo_providencia` on((`a_tipo_providencia`.`tipo` = `expedientes_fiscalizacion`.`tipo`))) join `z_siglas` on((`z_siglas`.`id_sector` = `vista_actas_hoja_sanciones_fis`.`sector`))) join `z_sectores` on((`z_sectores`.`id_sector` = `vista_actas_hoja_sanciones_fis`.`sector`))) join `contribuyentes` on((`contribuyentes`.`rif` = convert(`expedientes_fiscalizacion`.`rif` using utf8)))) join `dir_ciudades` on((`dir_ciudades`.`id_ciudad` = `contribuyentes`.`id_ciudad`))) where (`expedientes_fiscalizacion`.`anno` > 2017) ;

-- ----------------------------
-- View structure for vista_alm_detalle_ingreso
-- ----------------------------
DROP VIEW IF EXISTS `vista_alm_detalle_ingreso`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `vista_alm_detalle_ingreso` AS select `alm_ingresos`.`id_ingreso` AS `id_ingreso`,`alm_inventario`.`descripcion` AS `descripcion`,`alm_ingresos_detalle`.`cantidad` AS `cantidad`,`bn_categorias`.`codigo` AS `codigo`,`alm_inventario`.`unidad` AS `unidad`,`alm_ingresos_detalle`.`id_detalle` AS `id_detalle`,`alm_ingresos_detalle`.`id_articulo` AS `id_articulo` from (((`alm_ingresos` join `alm_ingresos_detalle` on((`alm_ingresos`.`id_ingreso` = `alm_ingresos_detalle`.`id_ingreso`))) join `alm_inventario` on((`alm_inventario`.`id_articulo` = `alm_ingresos_detalle`.`id_articulo`))) join `bn_categorias` on((`bn_categorias`.`id_categoria` = `alm_inventario`.`id_categoria`))) ;

-- ----------------------------
-- View structure for vista_alm_detalle_solicitud
-- ----------------------------
DROP VIEW IF EXISTS `vista_alm_detalle_solicitud`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `vista_alm_detalle_solicitud` AS SELECT
	alm_solicitudes.id_solicitud AS id_solicitud, 
	alm_inventario.descripcion AS descripcion, 
	alm_solicitudes_detalle.cant_solicitada AS cant_solicitada, 
	alm_solicitudes_detalle.cant_aprobada AS cant_aprobada, 
	bn_categorias.codigo AS codigo, 
	alm_inventario.unidad AS unidad, 
	alm_inventario.cantidad AS cantidad, 
	alm_solicitudes_detalle.id_detalle AS id_detalle, 
	alm_solicitudes_detalle.id_articulo AS id_articulo, 
	alm_solicitudes.`status` AS `status`, 
	alm_solicitudes_detalle.cant_despachada
FROM
	(
		(
			(
				alm_solicitudes
				JOIN
				alm_solicitudes_detalle
				ON 
					(
						(
							alm_solicitudes.id_solicitud = alm_solicitudes_detalle.id_solicitud
						)
					)
			)
			JOIN
			alm_inventario
			ON 
				(
					(
						alm_inventario.id_articulo = alm_solicitudes_detalle.id_articulo
					)
				)
		)
		JOIN
		bn_categorias
		ON 
			(
				(
					bn_categorias.id_categoria = alm_inventario.id_categoria
				)
			)
	) ;

