-- ----------------------------
-- View structure for vista_bienes_html
-- ----------------------------
DROP VIEW IF EXISTS `vista_bienes_html`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY INVOKER VIEW `vista_bienes_html` AS SELECT
	bn_bienes.id_bien AS id_bien, 
	bn_bienes.id_categoria AS id_categoria, 
	bn_bienes.id_area AS id_area, 
	bn_bienes.numero_bien AS numero_bien, 
	bn_bienes.descripcion_bien AS descripcion_bien, 
	bn_bienes.conservacion AS conservacion, 
	bn_bienes.valor AS valor, 
	bn_bienes.inf_ci_asignado AS inf_ci_asignado, 
	bn_bienes.inf_nombre_equipo AS inf_nombre_equipo, 
	bn_bienes.inf_categoria AS inf_categoria, 
	bn_bienes.por_reasignar AS por_reasignar, 
	bn_bienes.revisado AS revisado, 
	bn_bienes.usuario AS usuario, 
	bn_bienes.fechaproceso AS fechaproceso, 
	bn_bienes.borrado AS borrado, 
	bn_areas.descripcion AS area, 
	z_jefes_detalle.descripcion AS division, 
	z_jefes_detalle.division AS id_division, 
	bn_categorias.codigo AS codigo, 
	z_jefes_detalle.id_sector AS id_sector, 
	bn_bienes.serial, 
	bn_bienes.marca, 
	bn_bienes.modelo, 
	bn_bienes.color, 
	bn_bienes.fecha, 
	bn_bienes.factura, 
	bn_bienes.condicion, 
	concat(z_empleados.Apellidos,' ', z_empleados.Nombres) as funcionario
FROM
	(
		(
			(
				bn_bienes
				join
				bn_areas
			)
			join
			z_jefes_detalle
		)
		join
		bn_categorias
	)
	INNER JOIN
	z_empleados
	ON 
		bn_bienes.inf_ci_asignado = z_empleados.cedula
WHERE
	(
		(
			bn_bienes.id_area = bn_areas.id_area
		) AND
		(
			z_jefes_detalle.division = bn_areas.division
		) AND
		(
			bn_categorias.id_categoria = bn_bienes.id_categoria
		)
	) ;

