 = `bn_area_actual`.`division`))) join `z_jefes_detalle` `z_jefes_destino` on((`z_jefes_destino`.`division` = `bn_area_destino`.`division`))) join `z_sectores` `sectores_actual` on((`z_jefes_actual`.`id_sector` = `sectores_actual`.`id_sector`))) join `z_sectores` `sectores_destino` on((`z_jefes_destino`.`id_sector` = `sectores_destino`.`id_sector`))) join `bn_reasignaciones_detalle` on(((`bn_area_destino`.`id_area` = `bn_reasignaciones_detalle`.`id_area_destino`) and (`bn_area_actual`.`id_area` = `bn_reasignaciones_detalle`.`id_area_anterior`) and (`bn_reasignaciones_detalle`.`id_bien` = `bn_bienes`.`id_bien`)))) join `bn_reasignaciones` on((`bn_reasignaciones`.`id_reasignacion` = `bn_reasignaciones_detalle`.`id_reasignacion`))) ORDER BY bn_reasignaciones.id_reasignacion DESC ;

