fis_actas`.`num_prov` = `expedientes_fiscalizacion`.`numero`)))) join `z_sectores` on((`z_sectores`.`id_sector` = `expedientes_fiscalizacion`.`sector`))) left join `fis_actas_detalle` on((`fis_actas_detalle`.`id_acta` = `fis_actas`.`id_acta`))) group by `fis_actas_detalle`.`id_acta` ;

