CREATE ALGORITHM = UNDEFINED SQL SECURITY INVOKER VIEW `vista_transferidas_rif_liquidacion` AS select `expedientes_rif`.`Sector` AS `sector`,`expedientes_rif`.`Anno` AS `anno`,`expedientes_rif`.`Numero` AS `numero`,`expedientes_rif`.`FechaRegistro` AS `fecha_emision`,`expedientes_rif`.`Rif` AS `rif`,`vista_contribuyentes_direccion`.`contribuyente` AS `contribuyente`,`a_sancion`.`serie` AS `serie`,`a_sancion`.`sancion` AS `descripcion`,((`liquidacion`.`monto_bs` / `liquidacion`.`concurrencia`) * `liquidacion`.`especial`) AS `monto`,`liquidacion`.`fecha_transferencia_a_liq` AS `fecha_transferencia_a_liq`,`liquidacion`.`origen_liquidacion` AS `origen_liquidacion`,`vista_contribuyentes_direccion`.`Especial` AS `Especial`,`resoluciones`.`fecha` AS `fecha_res`,`liquidacion`.`id_resolucion` AS `id_resolucion` from ((((`expedientes_rif` join `liquidacion` on(((`liquidacion`.`anno_expediente` = `expedientes_rif`.`Anno`) and (`liquidacion`.`num_expediente` = `expedientes_rif`.`Numero`) and (`liquidacion`.`sector` = `expedientes_rif`.`Sector`)))) join `a_sancion` on((`a_sancion`.`id_sancion` = `liquidacion`.`id_sancion`))) join `vista_contribuyentes_direccion` on(((`vista_contribuyentes_direccion`.`rif` = convert(`expedientes_rif`.`Rif` using utf8)) and (`vista_contribuyentes_direccion`.`rif` = convert(`expedientes_rif`.`Rif` using utf8))))) join `resoluciones` on(((`resoluciones`.`id_sector` = `liquidacion`.`sector`) and (`resoluciones`.`id_origen` = `liquidacion`.`origen_liquidacion`) and (`liquidacion`.`anno_expediente` = `resoluciones`.`anno_expediente`) and (`resoluciones`.`num_expediente` = `liquidacion`.`num_expediente`)))) where ((`liquidacion`.`origen_liquidacion` = 12) and (`liquidacion`.`fecha_transferencia_a_liq` <> _utf8'0000-00-00') and (`liquidacion`.`fecha_transferencia_a_liq` is not null)) ;

