DROP VIEW IF EXISTS `zzzzz_ventas_timbre`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `zzzzz_ventas_timbre` AS select `timbre_ventas`.`numero` AS `numero`,`timbre_ventas`.`fecha` AS `fecha`,sum(`timbre_ventas`.`total`) AS `total`,`timbre_inv`.`grupo` AS `grupo` from (`timbre_ventas` join (`timbre_ventas_detalle` join `timbre_inv` on((`timbre_inv`.`codigo` = `timbre_ventas_detalle`.`codigo`)))) where ((`timbre_ventas`.`numero` = `timbre_ventas_detalle`.`numero_venta`) and (`timbre_ventas`.`fecha` <= '2016/12/31')) group by `timbre_ventas`.`numero` order by `timbre_ventas`.`fecha`,`timbre_ventas`.`numero` ;

-- ----------------------------
-- Triggers structure for table ct_salida_expediente
-- ----------------------------
DROP TRIGGER IF EXISTS `tg_marcar_casos_proceo_copy1`;
delimiter ;;
CREATE TRIGGER `tg_marcar_casos_proceo_copy1` AFTER INSERT ON `ct_salida_expediente` FOR EACH ROW BEGIN



	IF (new.Notificacion = 0) THEN

		UPDATE db_siger_fiscalizacion.casos_en_proceso SET db_siger_fiscalizacion.casos_en_proceso.borrado = 1,

			db_siger_fiscalizacion.casos_en_proceso.fecha_borrado = CURDATE() WHERE

			db_siger_fiscalizacion.casos_en_proceso.anno = new.Anno_Providencia AND

			db_siger_fiscalizacion.casos_en_proceso.numero = new.NroAutorizacion AND

			db_siger_fiscalizacion.casos_en_proceso.sector = new.sector;



	END IF;

END
;;
delimiter ;

