delimiter ;;
CREATE TRIGGER `tr_bu_liquidacion_not` BEFORE UPDATE ON `liquidacion` FOR EACH ROW UPDATE resoluciones SET fecha_liq_not = new.fecha_not WHERE id_sector=old.sector AND anno_expediente=old.anno_expediente AND num_expediente=old.num_expediente AND id_origen=old.origen_liquidacion AND fecha_liq_not is null
;;
delimiter ;

